import { Splide, SplideSlide } from "@splidejs/react-splide";

const SliderContainer = () => {
  return (
    <Splide>
      <SplideSlide>
        <img src="image1.jpg" alt="Image 1" />
      </SplideSlide>
      <SplideSlide>
        <img src="image2.jpg" alt="Image 2" />
      </SplideSlide>
    </Splide>
  );
};

export default SliderContainer;
